@import "./variables";

* {
    box-sizing: border-box;
    margin: 0;
    padding: 0;
    font-family: $font-family;
}

main {
    height: 100vh;
    background-color: $body-bg;
    @include flex-center;
}

.calculator {
    background-color: $white-bg;
    height: 570px;
    width: 400px;
    margin: 50px 10px;
    padding: 30px;
    border-radius: 20px;
}

.output {
    width: 100%;
    height: 120px;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    align-items: flex-end;
    background-color: rgb(236, 234, 234);
    border-radius: 20px;
    padding: 10px 20px;
    word-wrap: break-word;
    word-break: break-all;
    box-shadow: inset 5px 5px 0 rgb(145, 145, 145),
                inset -5px -5px 0 rgb(201, 201, 201);
    .prev-result {
        color: rgb(99, 92, 92);
        font-weight: 600;
        font-size: 1.2rem;
    }
    .current-result {
        font-weight: 600;
        font-size: 2rem;
    }
}

.keys {
    margin-top: 20px;
    display: flex;
    flex-direction: column;
    align-items: center;
}

.row {
    margin-bottom: 10px;
}

button {    
    font-family: $font-family;
    font-weight: 600;
    font-size:  1.5rem;
    border-radius: 10px;
    border: 0;
    margin: 5px;
    @include box-shadow(3px, 3px, 0, rgb(133, 133, 133));
}

.col-3 {
    padding: 0;
    width: 80px;
    height: 60px;
}

.col-6 {
    @extend .col-3;
    width: 165px;
}

.purple-bg {
    background-color: $purple-button;
    @include box-shadow(3px, 3px, 0, rgb(84, 3, 116));
}

.teal-bg {
    background-color: $teal-btn;
    @include box-shadow(3px, 3px, 0, rgb(145, 128, 151));
}

.clicked {
    @include box-shadow(inset -3px, 3px, 0, rgb(133, 133, 133));
}

